import re

import xlrd

def re_find_405_cmd(xml):
    # 寻找多个带有405数据的状态标签
    # <Status><CmdID>86</CmdID><CmdRef>47</CmdRef><MsgRef>2</MsgRef><Cmd>Get</Cmd><Data>405</Data></Status>
    pattern = re.compile(r'<Status><CmdID>[0-9]*</CmdID><CmdRef>[0-9]*</CmdRef><MsgRef>[0-9]*</MsgRef><Cmd>[a-zA-Z]*</Cmd><Data>405</Data></Status>')
    list = pattern.findall(xml)
    # print(list)

    cmd_405_list = []
    for str_405 in list :
        # print("405="+str_405)
        cmd = re.search(r'<CmdRef>(?P<id>[0-9]*)</CmdRef>',str_405).group('id')
        cmd_405_list.append(cmd)
    # return re.search(r'<SessionID>(?P<id>.*?)</SessionID>', xml).group('id')

    uri_list = read(diag_xml_path)
    # print("uri_list_len={}".format(len(uri_list)))

    uri_405_list = []
    for int_cmd_ref in cmd_405_list:
        index = int(int_cmd_ref) - 5
        # print("index={}".format(index))
        uri_405_list.append(uri_list[index])
        # print("index={},uri_list[index]={}".format(index,uri_list[index]))

    return uri_405_list

