def getTagList(startCmd):
    # 返回响应体中的<get>标签
    result = ""
    startCmd1 = startCmd
    get_tag_temp = """
    <Get>
	<CmdID>{cmd_id}</CmdID>
	<Item>
		<Target>
			<LocURI>{uri}</LocURI>
		</Target>
	</Item>
    </Get>
    """
    uri_list = read(diag_xml_path)
    for uri in uri_list:
        result += get_tag_temp.replace("{cmd_id}", str(startCmd1)).replace("{uri}", uri)
        startCmd1 = startCmd1 + 1

    return result


def read(file_name):
    """
    打开excel文件
    :param file_name: excel文件的绝对路径
    :return:
    """
    book = xlrd.open_workbook(filename=file_name)

    # print("表单数量:", book.nsheets)
    # print("表单名称:", book.sheet_names())
    # 获取第一个表单
    sheet = book.sheet_by_index(2)
    # print("表单 {} 共 {} 行 {} 列".format(sheet.name, sheet.nrows, sheet.ncols))

    # 找出有uri的那一列
    uri_col = -1
    id_list = []

    for i in range(sheet.ncols):
        # print("第一行列名称：", sheet.cell(rowx=0, colx=i))
        if 'URI' in sheet.cell(rowx=0, colx=i).value:
            uri_col = i
            break

    if uri_col != -1:
        id_list = list_all_id(sheet, uri_col)
    # print("URI LIST={}".format(id_list))

    return id_list


def list_all_id(sheet, id_col):
    # 列出所有URI

    result_ids = []
    # sheet所有列
    rows = sheet.nrows
    # 扫描ID对应的所有列
    for i in range(1, rows):
        # 获得ID值
        uri = sheet.cell(rowx=i, colx=id_col).value
        if uri == ".":
            continue
        result_ids.append(uri)
        # print("i={},uri={}".format(i,uri))
    return result_ids


